import React from 'react';

function Hello(props) {
    return (
        <>
            <div style={{color: props.color}}>
                안녕하세요 {props.name}
            </div>
            <div>
                {props.gender}
            </div>
        </>
    )

}

Hello.defaultProps = {
    name: '이름없음',
    gender : '남자'
}

export default Hello;
